import React, { Component,Fragment } from 'react';


class ShowPlayers extends Component {
  constructor(props){
    super(props)
    this.state = {
      players : props.location.state.playerInGame
    }
  }
  render() {
    let index = 0;
    return (
      <Fragment>
        <table>
        <th>Player Name</th>
              <th>Last Name</th>
              <th>Total Time</th>
              <th>Distance (km)</th>
              <th>Sprint Distance</th>
              <th> Total Sprints</th>
              <th>Sprints Avg(MP/H).</th>
              <td>
              {firstName.map(item => {
                return <tr key={index++}>{item}</tr>;
              })}
            </td>
            <td>
              {lastName.map(item => {
                return <tr key={index++}>{item}</tr>;
              })}
            </td>
            <td>
              {totalTime.map(item => {
                return <tr key={index++}>{item}</tr>;
              })}
            </td>
            <td>
              {distance.map(item => {
                return <tr key={index++}>{item}</tr>;
              })}
            </td>
            <td>
              {sprintDistance.map(item => {
                return <tr key={index++}>{item}</tr>;
              })}
            </td>
            <td>
              {sprints.map(item => {
                return <tr key={index++}>{item}</tr>;
              })}
            </td>
            <td>
              {sprintAvgID.map(item => {
                return <tr key={index++}>{item}</tr>;
              })}
            </td>
        </table>
      </Fragment>
    )
  }
}
export default ShowPlayers;
